import { type } from '@testing-library/user-event/dist/type';
import { useState, useContext } from 'react';
import React from 'react'

const inputText_ = React.createContext();
const setInputText_ = React.createContext();

const manager_ = React.createContext();
const windowSize_ = React.createContext();


export function useInputText (){
    return useContext (inputText_);
}
export function useSetInputText (){
    return useContext (setInputText_);
}

export function useManager (){
    return useContext (manager_);
}


export function AppManager (props) {


    return (
        <>
            <inputText_.Provider value={setInputText()}>
                {props.children}
            </inputText_.Provider>
        </>
    );
}
